import { Link } from 'react-router-dom';
function MenuItem({image, name, price,value}) {
  return (
    <div className='menuItem'>
    <div  style = {{ backgroundImage:`url(${image})`}}></div>
    <h1>{name}</h1>
    <br/>
    <p> $ {price} <br/>
    3 days week / Monthly.
    </p>
    <Link to='/contact'>{value}</Link>
    </div>
  )
}

export default MenuItem;
